import React, {Component} from 'react';
import { NavLink } from 'react-router-dom';

class Home extends Component {

    componentDidMount(){
        console.log(localStorage.getItem('team'));
    }

    render() {
        return (
            <div>
                Home
                <NavLink to="/aaa">Team 1</NavLink>
                <br/>
                <NavLink to="/bbb">Team 2</NavLink>
                <br/>

                <NavLink to="/ccc">Team 3</NavLink>
                <br/>


            </div>
        )
    }
}

export default Home;
